import React from 'react';
import TodoListItem from './todo-list-item'

const TodoList = () => {
  return(
    <ul>
      <li> <TodoListItem
        label = "Drink Coffe" /> </li>
      <li> <TodoListItem
        label = "Build an App"
        important /> </li>
    </ul>
  );
};

export default TodoList;
